import numpy as np
def heuristics_v2(el: tuple[int, ...], n: int, w: int) -> float:
    priority = 0.0
    for e in el:
        penalty = 0.0
        if e <= w:
            penalty = (w - e) ** 2
        else:
            penalty = (e - w) ** 2
        priority += penalty
    return -priority
